        lastName:''
    }
    handleChange=(e)=>{
        this.setState({
            [e.target.id]:e.target.value
        })
    }
    handleSubmit=(e)=>{        
        e.preventDefault();
        console.log(this.state);

    }
    render() {
        return (
            <div className="container">
                <form onSubmit={this.handleSubmit} className="white">      
                    <h5 className="grey-text text-darken-3">Sing In</h5>
                    <div className="input-field">
                        <label htmlFor="email">Email</label>
                        <input type="email" id="email" onChange={this.handleChange}></input>
                    </div>
                    <div className="input-field">
                        <label htmlFor="password">Password</label>
                        <input type="password" id="password" onChange={this.handleChange}></input>
                    </div>
                    <div className="input-field">
                        <label htmlFor="text">Firstname</label>
                        <input type="firstName" id="firstName" onChange={this.handleChange}></input>
                    </div>
                    <div className="input-field">
                        <label htmlFor="text">Lastname</label>
                        <input type="lastName" id="lastName" onChange={this.handleChange}></input>
                    </div>
                    <div className="input-field">
                        <button className="btn pink lighten-1 z-depth-0">Login</button>
                    </div>
                </form>  
            </div>
        )
    }
}

